import logo from './logo.svg';
import './App.css'; 
import NavScrollExample from './navbar'
// import { Navbar } from 'react-bootstrap'; 
// import { Carousel } from 'react-bootstrap'; 
import IndividualIntervalsExample  from './carousel';

function App() {
  return ( 
    <>
      <NavScrollExample/>    
        <h4>&nbsp;</h4>
        <div className={'container'}>
          <div className={'row'}>
          <div className={'col-md-4'}> 
            <Inspection onChange = {handle_get_property_id} property_kind = {handle_get_jenis_bangunan}/>  
          </div>
           <div className={'col-md-8'}> 
            <Spesification fetch_property = {id_property} fetch_jenis_bangunan = {id_jenis_bangunan}/>
           </div>
          </div>
        </div>
    </>

  );
}

export default App;
